import React from "react";
import {
  TouchableOpacity,
  TextInput,
  View,
  Text,
  Alert,
  Image,
} from "react-native";
import { Formik } from "formik";
import { StyleSheet } from "react-native-web";

const initialValues = {
  DNI: "",
  password: "",
};

const LoginScreen = () => {
  const handleNavigationToHome = () => {
    Alert.alert("hola");
  };
  return (
    <View>
      <Text>Mutual 12 de Septiembre</Text>

      <Text>Trabajando por el bienestar general</Text>
      <Formik
        initialValues={initialValues}
        onSubmit={(values) => console.log(values)}
      >
        {({ handleChange, handleBlur, handleSubmit, values }) => {
          return (
            <View style={style.containerForm}>
              <Text>Iniciar Sesion</Text>

              <TextInput
                style={style.textInput}
                placeholder="DNI"
                onChangeText={handleChange("DNI")}
                onBlur={handleBlur("DNI")}
                value={values.DNI}
              />
              <TextInput
                style={style.textInput}
                placeholder="ContraseÃ±a"
                onChangeText={handleChange("password")}
                onBlur={handleBlur("password")}
                value={values.password}
              />
              <TouchableOpacity style={style.container} onPress={handleSubmit}>
                <Text style={style.text}>Iniciar Sesion</Text>
              </TouchableOpacity>
            </View>
          );
        }}
      </Formik>
    </View>
  );
};

export default LoginScreen;

const style = StyleSheet.create({
  container: {
    marginHorizontal: 15,
    marginVertical: 15,
    width: 100,
    height: 30,
    borderRadius: 8,
    backgroundColor: "#000",
    justifyContent: "center",
    alignItems: "center",
  },
  text: {
    textAlign: "center",
    color: "#fff",
    fontSize: 15,
    fontWeight: "bold",
  },
  containerForm: {
    justifyContent: "center",
    borderWidth: 1,
    marginVertical: 150,
  },
  textInput: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",

    width: 300,
    marginVertical: 5,
    borderRadius: 8,
    borderWidth: 1,
    paddingHorizontal: 20,
    paddingVertical: 10,
  },
});
